import React from 'react';
import PIC_souvik from './Images/PIC_souvik.jpeg';
const Header=()=>{
    return(
        <>
        <div className='header'>
            <img src={PIC_souvik} alt="logo"/>
        </div>
        </>
    );
};
export default Header;
